import React from 'react';
import './App.css';


function Todo ({todo, index}) {
  {todo.text}
}

function App (){
  const [ todos, setTodos ] = React.useState([
    { text: 'Vadim'},
    { text: 'Slava'},
  ]);

  return(
    <div className='app'>
      <h1>Todos</h1>
      <div className='todo-list'>
        {todos.map((todo, index) => (
          <Todo 
            key={index}
            index={index}
            todo={todo}
          />

        ))}
      </div>
    </div>
  );





}

export default App;
